import React, { useState, useEffect } from "react";
import Confetti from "react-confetti";
import "../App.css"; // import your shared styles

const PasswordGame = () => {
  const [password, setPassword] = useState("");
  const [isStrong, setIsStrong] = useState(false);
  const [feedback, setFeedback] = useState("");
  const [hints, setHints] = useState([]);
  const [showConfetti, setShowConfetti] = useState(false);
  const [stats, setStats] = useState({ attempts: 0, passes: 0 });

  // Load stats from localStorage when the component mounts
  useEffect(() => {
    const savedStats = JSON.parse(localStorage.getItem("passwordStats"));
    if (savedStats) setStats(savedStats);
  }, []);

  // Save stats to localStorage whenever they change
  useEffect(() => {
    localStorage.setItem("passwordStats", JSON.stringify(stats));
  }, [stats]);

  const checkPassword = () => {
    const hasLetters = /[a-zA-Z]/.test(password);
    const hasNumbersOrChars = /[0-9!@#$%^&*]/.test(password);
    const isLongEnough = password.length >= 8;

    const strong = hasLetters && hasNumbersOrChars && isLongEnough;
    setIsStrong(strong);

    if (strong) {
      setFeedback("ðŸŽ‰ Your password is strong!");
      setHints([]);
      setShowConfetti(true);
      setStats((prev) => ({
        attempts: prev.attempts + 1,
        passes: prev.passes + 1,
      }));
    } else {
      setFeedback("âŒ Try again!");
      setHints(getHints(password));
      setShowConfetti(false);
      setStats((prev) => ({
        attempts: prev.attempts + 1,
        passes: prev.passes,
      }));
    }
  };

  const getHints = (pwd) => {
    const hints = [];
    if (pwd.length < 8) hints.push("Make it longer!");
    if (!/[0-9]/.test(pwd)) hints.push("Add a number!");
    if (!/[!@#$%^&*]/.test(pwd)) hints.push("Try a special character like ! or #");
    return hints;
  };

  // Calculate success rate
  const successRate =
    stats.attempts > 0 ? ((stats.passes / stats.attempts) * 100).toFixed(1) : 0;

  // Reset stats
  const resetStats = () => {
    setStats({ attempts: 0, passes: 0 });
    localStorage.removeItem("passwordStats");
  };

  return (
    <div className="cyber-container bg-gradient-primary flex-center">
      <div className="glass-card card-elevated">
        <input
          type="password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          placeholder="Enter a password"
          className="input-field"
        />
        <button onClick={checkPassword} className="btn-primary">
          Test Password
        </button>

        {showConfetti && <Confetti recycle={false} />}

        <p className={isStrong ? "text-gradient-primary" : "text-highlight-pink"}>
          {feedback}
        </p>

        {hints.length > 0 && (
          <ul>
            {hints.map((hint, i) => (
              <li key={i} className="text-highlight-purple">{hint}</li>
            ))}
          </ul>
        )}

        {/* Stats Display - all on one line */}
        <div className="stats-container">
          <div className="stat-item">
            <p className="stat-value">{stats.attempts}</p>
            <p className="stat-label">Attempts</p>
          </div>
          <div className="stat-item">
            <p className="stat-value">{stats.passes}</p>
            <p className="stat-label">Passes</p>
          </div>
          <div className="stat-item">
            <p className="stat-value">{successRate}%</p>
            <p className="stat-label">Success Rate</p>
          </div>
        </div>

        <button onClick={resetStats} className="btn-secondary">
          ðŸ”„ Start Over
        </button>
      </div>
    </div>
  );
};

export default PasswordGame;
